package com.ufgov.zc.common.zc.model;public class EmExpertTypeSelection extends TreeNodeValueObject {  private static final long serialVersionUID = 6586936049923871023L;  private EmExpertType emExpertType = new EmExpertType();  private Integer emExpertNum;  public String toString() {    if (getCode() == null || "".equals(getCode().trim())) {      return getName();    }    int num = getEmExpertNum() == null ? 0 : getEmExpertNum().intValue();    return "[" + getCode() + "]" + getName() + "(" + num + ")";  }  public EmExpertType getEmExpertType() {    return emExpertType;  }  public void setEmExpertType(EmExpertType emExpertType) {    this.emExpertType = emExpertType;  }  public Integer getEmExpertNum() {    return emExpertNum;  }  public void setEmExpertNum(Integer emExpertNum) {    this.emExpertNum = emExpertNum;  }}